INSERT INTO `t2_cmip6_exps` VALUES (1,'ssp245-GHG','Extension of well-mixed GHG-only run (hist-GHG) under SSP2-4.5 forcing to the year 2100. Models with interactive chemistry schemes should either turn off the chemistry or use a preindustrial climatology of stratospheric and tropospheric ozone in their radiation schemes.','f16d9740-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(2,'dcppA-historical-niff','A coordinated set of multi-member ensembles of retrospective forecasts (hindcasts) initialised each year from 1960 to the present (otherwise every second year).  Radiative and other forcing information (e.g. greenhouse gas concentrations, aerosols etc.) maintained at initial state value or projected in a simple way.  No inclusion of volcano or other short term forcing unless available at initial time. Initialise from the historical simulation. Run each member for at least 5 years, preferably 10 years.','f16dc6f2-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(3,'piClim-histall','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Transient forcing to be consistent with historical forcing used in the DAMIP hist-all experiment and future forcing to be consistent with the ScenarioMIP SSP2 RCP4.5 scenario forcing.  A small ensemble of three simulations from 1850-2100.','f16f32a8-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(4,'piClim-OC','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of organic carbon (OC). This is a timeslice experiment of 30 years total. Pre-Industrial ozone climatology should be used for models that don\'t model the ozone interactively.','70e43d4c-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(5,'aqua-p4K','Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.7c. Aquaplanet (no land) experiment with CO2 set to the AMIP mean concentration and no seasonal cycle.  Impose a uniform +4K perturbation to the zonally uniform SSTs of the aquaControl, on a planet without continents.','f16d4c86-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(6,'ssp434','Gap: Mitigation scenario with low radiative forcing by the end of the century.  Following approximately RCP3.4 global forcing pathway with SSP4 socioeconomic conditions. Radiative forcing reaches a level of 3.4 W/m2 in 2100. Concentration-driven.','f16f68b8-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL),(7,'dcppC-ipv-pos','Restore the Pacific sea surface temperature to positive Pacific Decadal Variability (PDV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16dd9b2-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(8,'dcppC-ipv-NexTrop-pos','Restore the extra-tropical north Pacific sea surface temperature to positive Pacific Decadal Variability (PDV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16dea60-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(9,'piClim-2xDMS','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The oceanic DMS (dimethyl sulphide) aerosol emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.','70e44a80-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(10,'amip-hist','Extended AMIP run that covers 1870-2014. All natural and anthropogenic historical forcings as used in CMIP6 Historical Simulation will be included. AGCM resolution as CMIP6 Historical Simulation. The HadISST data will be used.  Minimum number of integrations is 3, more realisations are encouraged.','f16e1cba-dd9e-11e6-b89b-ac72891c3257','GMMIP',NULL,'01.00.28',NULL),(11,'spinup-1950','The HighResMIP equivalent of the pre-industrial spinup with fixed 1950s forcing. The forcing consists of greenhouse gases, including ozone and aerosol loading for a 1950s (~10 year mean) climatology. For optimal comparison between models, use of plume aerosol concentrations is recommended (rather than emissions). Initial ocean conditions are taken from the EN4 (Good et al, 2013) ocean analysis over an average period of 1950-1954.  This spinup is short compared to DECK (30-50 years for example, to be manageable and consistent across resolutions) to produce initial conditions for control-1950 and hist-1950. At least one ensemble member for each resolution used int he coupled simulations (i.e. standard and high), where high is minimum atmosphere 25-50 km at mod-latitudes and ocean resolution of 0.25 degrees, and a minimum of daily coupling between ocean and atmosphere. Run for 30-50 years. ','6131ba78-4cff-11e7-903f-5404a60d96b5','HighResMIP',NULL,'01.00.28',NULL),(12,'piSST-4xCO2-solar','Time slice for the first year of the GeoMIP G1 experiment with fixed sea surface temperature climatology calculated from the piControl. Run for 10 years.','f16e41fe-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL),(13,'faf-all','Simultaneously apply anomalous fluxes of windstress, heat and freshwater using the passive-tracer method for heat as in the faf-heat experiment. Impose pre-industrial atmospheric conditions. Branch from the piControl at the same point as the 1pctCO2 experiment.','f16e19ea-dd9e-11e6-b89b-ac72891c3257','FAFMIP',NULL,'01.00.28',NULL),(14,'ssp126','SSP-based RCP scenario with low radiative forcing by the end of the century.  Following approximately RCP2.6 global forcing pathway with SSP1 socioeconomic conditions. Radiative forcing reaches a level of 2.6 W/m2 in 2100. Concentration-driven.','f16f6188-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL),(15,'ism-1pctCO2to4x-self','Stand alone ice sheet model driven offline by a CMIP6 model with 1% per year atmospheric carbon dioxide increased to quadrupling then held fixed for 200 years. Run for a minimum of 350 years (500 years encouraged).  The ice sheet model should be configured with the same settings as the ice sheet model in the ipctCO2to4x-withism experiment and should use the same initial conditions.','f16e7c14-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(16,'G6SST1','Time slice for the first year of the ScenarioMIP SSP5-85 (high forcing scenario) experiment. Run for 10 years.','f16e48d4-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL),(17,'ism-piControl-self','Stand alone ice sheet model driven offline by a CMIP6 model with piControl forcing. The ice sheet model should be configured with the same settings as the ice sheet model in the piControl-withism experiment and should use the same initial conditions.','f16e714c-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(18,'rad-irf','Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions. Use RFMIP specified atmospheric distributions of temperature and humidity and surface properties over many profiles.','f16f178c-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(19,'dcppC-pac-control','Restore the Pacific sea surface temperature to the model control run climatology.  Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16dd728-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(20,'piClim-NH3','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of ammonia (NH3). This is a timeslice experiment of 30 years total. Pre-Industrial ozone climatology should be used for models that don\'t model the ozone interactively.','70e44094-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(21,'G1','Extended version of GeoMIP experiment G1 (Kravitz et al., 2011). Beginning from a preindustrial control simulation (picontrol) the net top of atmosphere (TOA) radiative flux imbalance due to an abrupt quadrupling of the CO2 concentration (abrupt4xCO2) would be balanced via a reduction in total solar irradiance. Here, \"balance\" is defined as  the global mean value of top-of-atmosphere net radiative flux being within +-0.1 W/m2 of the piControl experiment over an average of years 1-10 of the simulation. The G1 experiment should be run for 50 years, however modelling groups that are not able to extend their previous (G1) model simulation should run the CMIP6 G1 experiment for the full 100 years. ','f16e30e2-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL),(22,'volc-long-hlN','Idealised high-latitude (60N) northern hemisphere eruption corresponding to an initial emission of 28.1 Tg of SO2 (equal to half the total amount injected for volc-long-eq).  volc-long-hlN is not directly comparable to the 1783-84 Laki eruption since it does not try to reproduce the very specific characteristics of Laki. The experiment is designed to span very different initial climate states to systematically assess uncertainties in post-eruption behaviour that are related to background climate conditions.  If, for instance, year Y of the control integration matches the desired conditions for the initial condition sampling, then the corresponding VolMIP simulation should start with restart data from year Y-1 of the control.  Run nine ensemble members for at least 20 years, but preferably longer (50 years) to cover the multi-decadal oceanic response. Initialisation date from the piControl start year is 1st April.','f16fa22e-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(23,'esm-hist-ext','Extension beyond 2014 of the CMIP6 historical simulation with atmospheric CO2 concentration calculated. To be performed with an Earth System Model (ESM) that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere.','f16fd136-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL),(24,'piClim-VOC','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of CO/VOC, all other emissions of tropospheric ozone precursors set to pre-industrial levels. This is a timeslice experiment of 30 years total.','70e435d6-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(25,'faf-heat','Impose surface heat flux anomalies to the ocean, calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling. Impose pre-industrial atmospheric conditions. Branch from the piControl at the same point as the 1pctCO2 experiment.','f16e1030-dd9e-11e6-b89b-ac72891c3257','FAFMIP',NULL,'01.00.28',NULL),(26,'dcppC-amv-pos','Restore the north Atlantic sea surface temperature to positive Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members.  SST signal may also be imposed by altering surface fluxes.','f16dd1e2-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(27,'amip-lfmip-pdLC','Scenario forced experiment with prescribed land surface climatology derived from \"present climate\" conditions (1980-2014) and prescribed SST (sea surface temperatures). SST configuration is taken from the AMIP runs in the DECK.','f16ec048-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL),(28,'land-crop-grass','Land surface model simulation.  Same as land-hist except with all new crop and pasture-land treated as unmanaged grassland. Start year either 1850 or 1700 depending on standard practice for particular model.','6e270aee-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(29,'piClim-anthro','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperature (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Anthropogenic forcing agents (greenhouse gases, aerosols and land use) are specified at present day, 2015, values. Run for 30 years.','f16f2754-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(30,'faf-passiveheat','Add a surface flux of passive tracer at the same rate as the surface heat flux perturbation, calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling. Impose pre-industrial atmospheric conditions. Branch from the piControl at the same point as the 1pctCO2 experiment. This experiment does not affect the model evolution,  so the experiment is equivalent to the piControl with an extra diagnostic tracer.','f16e1594-dd9e-11e6-b89b-ac72891c3257','FAFMIP',NULL,'01.00.28',NULL),(31,'pdSST-pdSIC','Atmosphere-only time slice present day control experiment forced by climatological monthly mean sea surface temperature (SST) and sea ice concentration (SIC) for the present day. Radiative forcing to be set to present day (year 2000) levels. All necessary SST and sea ice fields will be provided to participants by PAMIP.  Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa316-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(32,'hist-1950','Historical coupled ocean atmosphere simulations of the near past (1950-2014) at high and standard resolution. For optimal comparison between models aerosol concentrations are recommended (rather than emissions). At least one ensemble member at high resolution, minimum atmosphere 25-50 km at mid-latitudes and ocean resolution of 0.25 degrees, and a minimum of daily coupling between ocean and atmosphere. At least one ensemble member at standard model resolution.  Initial conditions from spin-up 1950\'s experiment.','6131bbe0-4cff-11e7-903f-5404a60d96b5','HighResMIP',NULL,'01.00.28',NULL),(33,'dcppC-atl-spg','Repeat DCCP-A1 hindcasts with altered initial conditions. Initialise with climatology (1960-2009 average) in the north Atlantic \"sub-polar ocean\" (95W-30E, 45N-90N).  Linear transition between climatology and actual observations over a 10 deg buffer zone (35N-45N).  10 ensemble members.  Run each member for at least 5 years, preferably 10 years.  Start dates end of 1993, 1994, 1995, 1996.  Additional start dates at end of 1992, 1997, 1998, 1999.','f16df5d2-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(34,'piClim-CH4','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply present day (2014) concentrations of methane (CH4) all other WMGHG (well mixed greenhouse gas) concentrations set to pre-industrial levels.  Apply pre-industrial emissions of NTCF (near term climate forcers). This is a timeslice experiment of 30 years total.','70e42898-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(35,'hist-resAMO','Pacemaker 20th century historical run that includes all forcings as used in CMIP6 historical simulation. Sea surface temperature (SST) is restored to the model climatology plus observational historical anomaly in the AMO domain (0-70oN, 70oW-0o). Use the same model resolutions as the CMIP6 historical simulation. The minimum number of integrations is 3, more realisations are encouraged.','f16e24c6-dd9e-11e6-b89b-ac72891c3257','GMMIP',NULL,'01.00.28',NULL),(36,'hist-all-aer2','Very like the hist-all (histALL) simulations except that they contain alternative estimates of aerosol forcing.','f16db3ec-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(37,'piSST-4xCO2','An AGCM experiment with monthly-varying SSTs and sea-ice taken from each model\'s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run) with quadrupled CO2 concentration seen by the radiation code and the vegetation code. Other atmospheric constituents and any other necessary boundary conditions (e.g. vegetation if required) taken from each model\'s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run). Dynamic vegetation should be turned off and the vegetation distribution that is output from the piControl simulation used. Same as piSST-control but CO2 is quadrupled. The increase in CO2 is seen by both the radiation scheme and vegetation.','f16d7d96-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(38,'lfmip-pdLC','Scenario forced experiment with prescribed land surface climatology derived from \"present climate\" conditions (1980-2014).  The experiment is comprised of transient coupled atmosphere-ocean simulations in which a selection of land surface characteristics is prescribed rather than interactively calculated in the model.  The \"climatological\" land surface forcing is calculated as the mean annual cycle in the period 1980-2014 from the historical GCM simulations. Additional ensemble members are requested with tier 2 priority.','f16eb9c2-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL),(39,'ism-bsmb-std','InitMIP basal melt anomaly experiment. Apply a prescribed anomaly of basal melting rate under floating ice, provided by ISMIP6, which simulates a doubling of sub-ice-shelf melting after 40 years of simulation for models with initial melting rates close to today\'s observations. Keep the Surface Mass Balance (SMB) the same as in the ism-ctrl-std experiment.  All other model parameters and forcings are the same as those used for initialization. Neither SMB anomaly nor bedrock topography should be adjusted in response to ice-sheet geometric changes in this experiment. However, groups are encouraged to submit multiple \"physics\" ensemble members for example by changing the sliding law, stress balance approximation, model resolution, or datasets (such as using different bedrocks). ','f16ea7a2-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(40,'G6solar','Using solar irradiance reduction, return the radiative forcing from a background of the ScenarioMIP high forcing (SSP5-85) to the ScenarioMIP middle forcing (SSP2-45).  Geoengineering will be simulated over years 2020 to 2100.','f16e3a6a-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL),(41,'1pctCO2Ndep-bgc','Biogeochemically-coupled concentration driven 1% per year increasing CO2 up to 4XCO2 simulation. CO2 increase only affects carbon cycle models, radiative code sees pre-industrial CO2.  With time varying anthropogenic nitrogen deposition.  Only applicable to models whose simulation will be affected by the deposition of reactive nitrogen either due to terrestrial or marine nitrogen cycle effects on carbon fluxes and store.','f16d28b4-dd9e-11e6-b89b-ac72891c3257','C4MIP',NULL,'01.00.28',NULL),(42,'control-1950','The HighResMIP equivalent of the pre-industrial control with fixed 1950s forcing.  The forcing consists of greenhouse gases, including ozone and aerosol loading for a 1950s (~10 year mean) climatology.  For optimal comparison between models, aerosol concentrations are recommended (rather than emissions). Initial conditions from the spinup-1950 experiment. At least one ensemble member at high resolution, minimum atmosphere 25-50 km at mid-latitudes and ocean resolution of 0.25 degrees, and a minimum of daily coupling between ocean and atmosphere. At least one ensemble member at standard model resolution. Run for 100 years. ','6131b7d0-4cff-11e7-903f-5404a60d96b5','HighResMIP',NULL,'01.00.28',NULL),(43,'ssp370-lowNTCF','SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced NTCF emissions. SSP3 socioeconomic conditions. ','70e3f4fe-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(44,'piSST-4xCO2-rad','An AGCM experiment with monthly-varying SSTs and sea-ice taken from each model\'s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run) but with quadrupled CO2 concentration seen by the radiation code. Other atmospheric constituents and any other necessary boundary conditions (e.g. vegetation if required) taken from each model\'s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run). Dynamic vegetation should be turned off and the vegetation distribution that is output from the piControl simulation used. Same as piSST-control but CO2 as seen by the radiation scheme is quadrupled.','f16d79cc-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(45,'amip-lfmip-rmLC','Scenario forced experiment with prescribed land surface climatology derived from 30 year running mean and prescribed SST (sea surface temperatures).','f16ecab6-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL),(46,'pdSST-futAntSIC','Atmosphere-only time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day sea and future Antarctic sea ice concentration (SIC). Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa31d-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(47,'volc-cluster-21C','Parallel experiment to volc-cluster-ctrl but with initial conditions from the end of the historical simulation instead of from the piControl. The first eruption of the cluster begins in 2015. All external forcings, except volcanic forcing are from the 21st-century SSP2-4.5 scenario experiment of ScenarioMIP. At the end of the volcanic cluster, volcanic forcing input shall be kept constant at the same constant value prescribed for the piControl simulation for consistency with the SSP2-4.5 scenario experiment. At least one, preferably three ensemble members. 85 years for each ensemble member.','f16fb64c-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(48,'ism-asmb-std','InitMIP surface mass balance (SMB) anomaly experiment. Apply a prescribed SMB anomaly, provided by ISMIP6,  which mimics the expected SMB change from the end of the 20th century to the end of the 21st century. All other model parameters and forcings are the same as those used for initialization. Neither SMB anomaly nor bedrock topography should be adjusted in response to ice-sheet geometric changes in this experiment. However, groups are encouraged to submit multiple \"physics\" ensemble members for example by changing the sliding law, stress balance approximation, model resolution, or datasets (such as using different bedrocks). ','f16ea50e-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(49,'highresSST-future','High forcing (ScenarioMIP SSP5-85) future scenario (2015-2050) atmosphere only simulations at high and standard resolution, with an option to continue to 2100. For optimal comparison between models aerosol concentrations are recommended (rather than emissions). Future SST and SIC are determined from a blend of warming rates derived from an ensemble mean of CMIP5 RCP8.5 simulations and interannual variability derived from the historic 1960-2014 period. At least one ensemble member at high resolution, minimum atmosphere 25-50 km at mid-latitudes. At least one ensemble member at standard model resolution.','6532c6cc-4cfe-11e7-903f-5404a60d96b5','HighResMIP',NULL,'01.00.28',NULL),(50,'esm-ssp585-ssp126Lu','Keep all forcings the same as C4MIP esm-ssp585 scenario, but replace land use with ScenarioMIP SSP1-2.6  (aforestation) scenario. Emission driven.','f16ef464-dd9e-11e6-b89b-ac72891c3257','LUMIP',NULL,'01.00.28',NULL),(51,'ssp585-bgc','SSP-based RCP scenario with high radiative forcing by the end of century. Following approximately RCP8.5 global forcing pathway with SSP5 socioeconomic conditions. Concentration-driven.  Radiative effects of CO2 disabled - i.e. the radiation code is fed the time-invariant CO2 concentration from the control run.','f16d3372-dd9e-11e6-b89b-ac72891c3257','C4MIP',NULL,'01.00.28',NULL),(52,'dcppA-hindcast','A coordinated set of multi-member ensembles of retrospective forecasts (hindcasts) initialised each year from 1960 to the present (otherwise every second year). Prescribed CMIP6 historical values of atmospheric composition and/or emissions (and other conditions including volcanic aerosols).  Future forcing as the SSP2-4.5 scenario. Run each member for at least 5 years, extend the duration to 10 years with Tier-2 priority.  Additional ensemble members for each start date are requested with Tier-3 priority.','f16dba9a-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(53,'G6SST2-sulfur','Time slice at year 2100 of GeoMIP G6sulfur. Run for 10 years.','f16e4c26-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL),(54,'piClim-aer','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperature (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Aerosols are set to present day (2014) values, other forcing agents are specified at pre-industrial values.  Run for 30 years.','f16f2d1c-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(55,'piClim-ghg','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperature (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Greenhouse gases set to present day (2014) values, other forcing agents are specified at pre-industrial values.  Run for 30 years.','f16f2a2e-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(56,'omip1-spunup','Global ocean/sea-ice/inert-chemical/biogeochemical experiment.  Rather than using observed climatologies to initialise the biogeochemistry as in omipv1, this simulation will be initialised with model tracer fields that have been spun up for at least 2000 years, ideally for 5000 years.  The omipv1-spunup simulations (and spin-ups) will include radiocarbon (abiotic DIC and DI14C). Atmospheric forcing follows CORE-II, inert chemical tracers follow OCMIP2, and biogeochemical tracers follow OCMIP3. Only for modelling groups that have biogeochemistry and are able to afford a millennial-scale spin-up.','fed77bc2-4d00-11e7-903f-5404a60d96b5','OMIP',NULL,'01.00.28',NULL),(57,'histSST-1950HC','Historical atmosphere only simulation with historical WMGHG, transient historical SSTs. Ozone depleting substances fixed at 1950 emission levels. ','70e3ea68-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(58,'control-slab','Pre-Industrial control simulation with a slab ocean. Maintain the same constant boundary forcing as the pre-industrial control integration.','f16fafd0-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(59,'ssp370SST-lowAer','SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced aerosol precursors (not NOx). SSP3 socioeconomic conditions. Atmosphere only with SST from experiment SSP3-70.','70e405ac-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(60,'ism-ssp585-std','Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for the SSP5-85 climate forcing scenario.','f16e969a-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(61,'piClim-2xVOC','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The biogenic VOC (volatile organic compounds) emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.','70e450fc-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(62,'ism-lig127k-std','Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for the PMIP4 Last Interglacial experiment, lig124k.','f16e9d5c-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(63,'ism-amip-std','Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for the DECK amip climate experiment.','f16e9956-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(64,'amip-climSIC','Atmosphere-only transient experiment. Repeat CMIP6 AMIP (1979-2014) but with climatological monthly mean sea ice concentration (SIC) provided by PAMIP. Prescribe historical sea surface temperature (SST) as used in the AMIP experiment.  Other conditions as in the CMIP6 Historical simulation. Minimum ensemble size is 3 simulations.','661fa32a-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(65,'pdSST-futBKSeasSIC','Atmosphere-only time slice experiment to investigate regional forcing. Time slice forced by climatological monthly mean sea surface temperature (SST) for the present day and future Arctic sea ice concentration (SIC) only in the Barents and Kara Seas. Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa326-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(66,'volc-long-eq','Idealised equatorial eruption corresponding to an initial emission of 56.2 Tg of SO2. This eruption has a magnitude roughly corresponding to the 1815 Mt Tambora eruption in Indonesia, which was linked to the so-called \"year without a summer\" in 1816.  Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions.  If, for instance, year Y of the control integration matches the desired conditions for the initial condition sampling, then the corresponding VolMIP simulation should start with restart data from year Y-1 of the control.  Run nine ensemble members for at least 20 years','f16f8a00-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(67,'lfmip-rmLC','Scenario forced experiment with prescribed land surface climatology derived from transient 30 year running mean.   Additional ensemble members are requested with tier 2 priority.','f16ec598-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL),(68,'abrupt-solp4p','Conceptually similar to the abrupt 4xCO2 DECK experiment, except that the solar constant rather than CO2 is abruptly increased by 4%.','f16d63d8-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(69,'amip-p4K-lwoff','Continuation of CFMIP-2 amip4K experiment and CMIP5 experiment 6.8.  Add a uniform +4 K to the sea surface temperatures (SSTs) of the AMIP experiment but with cloud-radiative effects switched off in the LW radiation code. The SST warming should be applied to the ice free ocean surface only.  Sea ice and SSTs under sea ice remain the same as in the amip DECK experiment.','f16d5924-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(70,'amip-climSST','Atmosphere-only transient experiment. Repeat CMIP6 AMIP (1979-2014) but with climatological monthly mean sea surface temperature (SST) provided by PAMIP.  Prescribe historical sea ice concentration (SIC) as used in the AMIP experiment.  Other conditions as in the CMIP6 Historical simulation. Minimum ensemble size is 3 simulations.','661fa329-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(71,'abrupt-0p5xCO2','Impose an instantaneous halving of the concentration of atmospheric carbon dioxide, then hold fixed.','f16d6bda-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(72,'abrupt-2xCO2','Impose an instantaneous doubling of the concentration of atmospheric carbon dioxide, then hold fixed.','f16d6946-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(73,'dcppC-hindcast-noElChichon','Prediction experiment without volcano forcing. Repeat DCCP-A1 1982 hindcast without El Chichon forcing. Background volcanic aerosol to be the same as that used in the 2015 forecast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.','f16dfde8-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(74,'dcppC-amv-ExTrop-neg','Restore the extra-tropical north Atlantic sea surface temperature to negative Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16de164-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(75,'hist-piAer','Historical WMGHG and Halocarbon concentrations.  Historical ozone precursor emissions (e.g. NOx).  Aerosols and aerosol precursors fixed at 1850 emission levels.','70e323b2-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(76,'amip-TIP-nosh','Surface sensible heat released at the elevation above 500m over the Tibetan Plateau (TIP) is not allowed to heat the atmosphere. Other settings are the same as the standard DECK AMIP simulation. Minimum number of integrations is 1.','f16e2b7e-dd9e-11e6-b89b-ac72891c3257','GMMIP',NULL,'01.00.28',NULL),(77,'piClim-N2O','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply present day (2014) concentrations of nitrous oxide (N2O) all other WMGHG (well mixed greenhouse gas) concentrations set to pre-industrial levels.  Apply pre-industrial emissions of NTCF (near term climate forcers). This is a timeslice experiment of 30 years total.  Only models with stratospheric chemistry should run this experiment.','70e42c08-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(78,'hist-resIPO','Pacemaker 20th century historical run that includes all forcings as used in CMIP6 historical simulation. Sea surface temperature (SST) is restored to the model climatology plus observational historical anomaly in the tropical lobe of the IPO domain (20oS-20oN, 175oE-75oW). Use the same model resolutions as the CMIP6 historical simulation. Minimum number of integrations is 3, more realisations are encouraged.','f16e20ca-dd9e-11e6-b89b-ac72891c3257','GMMIP',NULL,'01.00.28',NULL),(79,'land-hist-altStartYear','Land surface model simulation. Same as land-hist except starting from either 1700 (for models that typically start in 1850) or 1850 (for models that typically start in 1700).   Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active.  Forced with historical observed climate. Include transient CO2, Nitrogen deposition, aerosol deposition and population density. This experiment can and likely will be a different configuration across models due to different representations of land use for each model.','6e271200-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(80,'hist-GHG','Historical greenhouse-gas only simulations resemble the historical simulations but instead are forced by well-mixed greenhouse gas changes only. Models with interactive chemistry schemes should either turn off the chemistry or use a preindustrial climatology of stratospheric and tropospheric ozone in their radiation schemes.  This will ensure that ozone is fixed in all these simulations, and simulated responses in models with and without coupled chemistry are comparable. Report what sets of emissions and boundary conditions are used.','f16d8f5c-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(81,'volc-pinatubo-slab','1991 Pinatubo forcing as used in the CMIP6 historical simulations.  Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. Requires special diagnostics of parameterised and resolved wave forcings, radiative and latent heating rates. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions. Sampling of an eastern phase of the Quasi-Biennial Oscillation (QBO), as observed after the 1991 Pinatubo eruption is preferred for those models that spontaneously generate such mode of stratospheric variability. Run at least 25 ensemble members for 3 years. Use a model configuration with a slab ocean.','f16fa8e6-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(82,'ssp370SST-lowCH4','SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced  methane emissions. SSP3 socioeconomic conditions. Atmosphere only with SST from experiment SSP3-70. ','70e40c46-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(83,'amip-lwoff','Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 3.3. AMIP forcing but with cloud-radiative effects switched off in the LW radiation code.','f16d550a-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(84,'ssp245-nat','An extension of at least one of the hist-nat (histNAT) simulations to the year 2100 following SSP2-45 solar and volcanic forcing. The future solar forcing data recommended for CMIP6 has a downward trend (Matthes et al., 2016).','f16db13a-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(85,'amip-m4K','AMIP experiment where SSTs are subject to a uniform cooling of 4K. This cooling should be applied to the ice free ocean surface only.  Sea ice and SSTs under sea ice remain the same as in the amip DECK experiment.','f16d521c-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(86,'pa-piAntSIC','Coupled ocean-atmosphere time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day and pre-industrial Antarctic sea ice concentration (SIC). Sea ice concentration to be nudged into coupled model with a relaxation time-scale of 1 day. Radiative forcing to be set to present day (year 2000) levels.  Initial conditions for coupled model experiments to be taken from year 2000 of coupled model CMIP6 historical simulations. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa323-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(87,'pdSST-futArcSIC','Atmosphere-only time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day sea and future Actic sea ice concentration (SIC). Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa31b-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(88,'1pctCO2','Increase atmospheric CO2 concentration gradually at a rate of 1 percent per year. The concentration of atmospheric carbon dioxide is increased from the global annual mean 1850 value until quadrupling. ','f16fc0b0-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL),(89,'dcppC-amv-Trop-neg','Restore the tropical north Atlantic sea surface temperature to negative Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16de6b4-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(90,'piClim-spAer-aer','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.   Aerosols and ozone set to present day (2015) values and other anthropogenic forcing agents are set at pre-industrial values.  Aerosols are specified by RFMIP. Run for 30 years.','f16f4c7a-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(91,'piClim-SO2','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of sulfur dioxide (SO2). This is a timeslice experiment of 30 years total.  Pre-Industrial ozone climatology should be used for models that don\'t model the ozone interactively.','70e43928-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(92,'ssp370SST-lowBC','SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced black carbon emissions. SSP3 socioeconomic conditions. Atmosphere only with SST from ScenarioMIP experiment SSP3-70.','70e4023c-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(93,'hist-piNTCF','Impose historical WMGHG and halocarbon concentrations. Near Term Climate Forcers (NTCFs), namely tropospheric aerosols and tropospheric ozone precursors, to be  fixed at 1850 emission levels. These simulations parallel the \"CMIP6 historical\", and differ only by fixing the anthropogenic emissions or concentrations of a specified class of species.   All other forcing agents must evolve as in \"CMIP6 historical\".','70e285ce-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(94,'past1000','For the period from 850 to 1850 CE (the millennium before the start of the industrial revolution), impose boundary conditions of solar variations, volcanic aerosols, atmospheric concentration of well-mixed greenhouse gases, land use and orbital parameters.  Run for 1000 years after spin-up period. It is mandatory that the model versions used for the PMIP-CMIP6 experiments are the exactly the same as for the other CMIP6 experiments, in particular the DECK and historical simulations.','f16f0af8-dd9e-11e6-b89b-ac72891c3257','PMIP',NULL,'01.00.28',NULL),(95,'land-crop-noIrrig','Land surface model simulation.  Same as land-hist except with irrigated area held at 1850 levels. Irrigation amounts within the 1850 irrigated area are allowed to change. Only relevant if land-hist utilises at least some form of crop management (e.g. planting and harvesting).  Start year either 1850 or 1700 depending on standard practice for particular model.','6e270d5a-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(96,'ssp585','SSP-based RCP scenario with high radiative forcing by the end of century. Following approximately RCP8.5 global forcing pathway with SSP5 socioeconomic conditions. Concentration-driven.','f16f5684-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL),(97,'hist-stratO3','This experiment\'s simulations resemble the historical simulations but are forced with stratospheric ozone concentrations only. In models with coupled chemistry, the chemistry scheme should be turned off, and the simulated ensemble mean monthly mean 3D stratospheric ozone concentrations from the CMIP6 historical simulations should be prescribed. Tropospheric ozone should be fixed at 3D long-term monthly mean piControl values, with grid cells having an ozone concentration below 100 ppbv in the piControl climatology for a given month classed as tropospheric. In models without coupled chemistry the same stratospheric ozone prescribed in CMIP6 historical experiment should be prescribed.','f16d9b32-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(98,'lig127k','Impose Last Interglacial (127 kyr ago) boundary conditions for the atmospheric concentration of well-mixed greenhouse gases and orbital parameters.  Run for at least 100 years after spin-up. It is mandatory that the model versions used for the PMIP-CMIP6 experiments are the exactly the same as for the other CMIP6 experiments, in particular the DECK and historical simulations.','f16f1354-dd9e-11e6-b89b-ac72891c3257','PMIP',NULL,'01.00.28',NULL),(99,'land-noShiftCultivate','Land surface model simulation. Same as land-hist except shifting cultivation turned off. (i.e. with net transitions instead of gross).  Start year either 1850 or 1700 depending on standard practice for particular model. ','6e271598-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(100,'ism-pdControl-std','Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for constant present day forcing.  Forcings are set to the end of the initialisation procedure, which ranges from 1990s to 2014.','f16e7408-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(101,'abrupt-4xCO2','Impose an instantaneous quadrupling of the concentration of atmospheric carbon dioxide from the global annual mean 1850 value, then hold fixed. ','f16fbe1c-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL),(102,'lfmip-pdLC-wfdei','Scenario forced experiment with prescribed land surface climatology derived from land-hist-wfdei (1980-2014). The experiment is comprised of transient coupled atmosphere-ocean simulations in which a selection of land surface characteristics is prescribed rather than interactively calculated in the model.  The \"climatological\" land surface forcing is calculated as the mean annual cycle in the period 1980-2014 from the land-hist-wfdei simulations.','623a9cf8-4cfc-11e7-903f-5404a60d96b5','LS3MIP',NULL,'01.00.28',NULL),(103,'faf-stress','Impose a perturbation in surface zonal and meridional momentum flux i.e. wind stress.  The stress perturbation is added to the momentum balance of the ocean water surface. The stress perturbation is calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling.  Its dominant feature is the increase in westerly windstress in the Southern Ocean. Impose pre-industrial atmospheric conditions.  Branch from the piControl at the same point as the 1pctCO2 experiment.','f16e0c20-dd9e-11e6-b89b-ac72891c3257','FAFMIP',NULL,'01.00.28',NULL),(104,'1pctCO2to4x-withism','Increase atmospheric carbon dioxide by 1% per year to quadrupling then hold fixed for 200 years in a model with interactive ice sheets. The experiment should be identical to the corresponding standard CMIP AOGCM experiment except for the treatment of ice sheets. 1pctCO2to4x-withism forcing differs from the 1% increase in CO2 experiment in that  after year 140 , when the CO2 levels = 4xCO2, the concentration of CO2 remains set to 4xCO2 for the remainder of the experiment Run for a minimum of 350 years (500 years encouraged).','f16e76a6-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(105,'piClim-HC','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply present day (2014) concentrations of ozone depleting halocarbons (ODS) all other WMGHG (well mixed greenhouse gas) concentrations set to pre-industrial levels.  Apply pre-industrial emissions of NTCF (near term climate forcers). This is a timeslice experiment of 30 years total. Only models with stratospheric chemistry should run this experiment.','70e42f5a-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(106,'ssp370SST-ssp126Lu','SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with low land use change from exeperiment ssp126. Atmosphere only with SST from experiment SSP3-70.','70e40f84-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(107,'historical','Simulation of recent past (1850 to 2014). Impose changing conditions (consistent with observations). Should be initialised from a point early enough in the pre-industrial control run to ensure that the end of all the perturbed runs branching from the end of this historical run end before the end of the control. Only one ensemble member is requested but modelling groups are strongly encouraged to submit at least three ensemble members of their CMIP historical simulation. ','f16fc5c4-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL),(108,'midHolocene','Impose Mid-Holocene (6 kyr ago) boundary conditions for orbital parameters and the atmospheric concentration of well-mixed greenhouse gases. Run for at least 100 years after spin-up. It is mandatory that the model versions used for the PMIP-CMIP6 experiments are the exactly the same as for the other CMIP6 experiments, in particular the DECK and historical simulations.','f16f06a2-dd9e-11e6-b89b-ac72891c3257','PMIP',NULL,'01.00.28',NULL),(109,'amip-TIP','The topography of the Tibetan Plateau (TIP) and other Asian highlands is modified by setting surface elevations to 500m. Other settings are the same as the standard DECK AMIP simulation. Minimum number of integrations is 1.','f16e2778-dd9e-11e6-b89b-ac72891c3257','GMMIP',NULL,'01.00.28',NULL),(110,'land-cCO2','Land surface model simulation.  Same as land-hist except with CO2 held constant. Branch from end of land-hist spin-up period.  Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active. Start year either 1850 or 1700 depending on standard practice for particular model. This experiment can and likely will be a different configuration across models due to different representations of land use for each model.','6e27086e-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(111,'highresSST-LAI','Similar to the HighResMIP highresSST-present experiment but using an common LAI dataset across models.  Historical atmosphere-only simulations of the near past (1979-2014).  HadISST2.2 sea surface temperature and sea ice concentrations at daily 1/4 degree resolution to be used (Kennedy et al. 2017, in prep).  Land surface forcing to use a common 1/4 degree resolution mean LAI3g dataset provided by HighResMIP. At least one ensemble member at high resolution, minimum 25-50 km at mid-latitudes. Initial conditions from the highresSST-present experiment.','6532c56e-4cfe-11e7-903f-5404a60d96b5','HighResMIP',NULL,'01.00.28',NULL),(112,'faf-water','Impose surface freshwater flux anomalies to the ocean (including the contribution from runoff change), calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling. Impose pre-industrial atmospheric conditions. Branch from the piControl at the same point as the 1pctCO2 experiment.','f16e12ec-dd9e-11e6-b89b-ac72891c3257','FAFMIP',NULL,'01.00.28',NULL),(113,'ism-historical-self','Stand alone ice sheet model driven offline by a CMIP6 model with historical forcing.  The ice sheet model should be configured with the same settings as the ice sheet model in the historical-withism experiment and should use the same initial conditions.','f16e893e-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(114,'pdSST-piArcSIC','Atmosphere-only time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day sea and pre-industrial Actic sea ice concentration (SIC). Radiative forcing to be set to present day (year 2000) levels. Past SIC will be computed from the ensemble of CMIP5 simulations by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa31a-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(115,'land-hist-altLu1','Land surface model simulation.  Same as land-hist except using alternative high land-use history reconstructions that span uncertainty in agriculture and wood harvest.  Note that land use in 1700 and 1850 will be different to that in land-hist so model will need to be spun up again for each alternative dataset. Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active. This experiment can and likely will be a different configuration across models due to different representations of land use for each model.','6e270fa8-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(116,'dcppA-assim','Ensemble of \'assimilation\' run(s) (if available). These are simulations used to incorporate observation-based data into the model in order to generate initial conditions for hindcasts. They parallel the historical simulations and use the same forcing. The number of years (60-600) depends on the number of independent assimilation runs.','f16dbe96-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(117,'G7cirrus','Against a background of the ScenarioMIP high forcing (SSP5-85), reduce cirrus cloud optical depth by a constant amount. Geoengineering will be simulated over years 2020 to 2100.','f16e3de4-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL),(118,'land-hist-altLu2','Land surface model simulation.  Same as land-hist except using alternative low land-use history reconstructions that span uncertainty in agriculture and wood harvest.  Note that land use in 1700 and 1850 will be different to that in land-hist so model will need to be spun up again for each alternative dataset. Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active. This experiment can and likely will be a different configuration across models due to different representations of land use for each model.','6e2710d4-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(119,'piClim-histghg','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Transient forcing with greenhouse gases (GHG) to be consistent with the historical forcing used in the DAMIP hist-all experiment and future forcing in the ScenarioMIP SSP2 RCP4.5 scenario. A small ensemble of three simulations from 1850-2100.','f16f3ce4-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(120,'piSST-pdSIC','Atmosphere-only time slice experiment forced by climatological monthly mean sea ice concentration (SIC) for the present day and pre-industrial sea surface temperature (SST).  Radiative forcing to be set to present day (year 2000) levels. Past SST will be computed from the ensemble of CMIP5 simulations by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa318-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(121,'ssp245','SSP-based RCP scenario with medium radiative forcing by the end of the century.  Following approximately RCP4.5 global forcing pathway with SSP2 socioeconomic conditions. Radiative forcing reaches a level of 4.5 W/m2 in 2100. Concentration-driven.','f16f5da0-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL),(122,'dcppA-hindcast-niff','A coordinated set of multi-member ensembles of retrospective forecasts (hindcasts) initialised each year from 1960 to the present (otherwise every second year). Radiative and other forcing information (e.g. greenhouse gas concentrations, aerosols etc.) maintained at initial state value or projected in a simple way.  No inclusion of volcano or other short term forcing unless available at initial time.  Initialise from observations.  Run each member for at least 5 years, preferably 10 years.','f16dc42c-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(123,'piControl','A pre-industrial control simulation with non-evolving pre-industrial conditions. Conditions chosen to be representative of the period prior to the onset of large-scale industrialization, with 1850 being the reference year.  The piControl starts after an initial climate spin-up, during which the climate begins to come into balance with the forcing. The recommended minimum length for the piControl is 500 years.','f16fb9da-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL),(124,'esm-piControl','A pre-industrial control simulation with non-evolving pre-industrial conditions and atmospheric CO2 calculated. Conditions chosen to be representative of the period prior to the onset of large-scale industrialization, with 1850 being the reference year.  The piControl starts after an initial climate spin-up, during which the climate begins to come into balance with the forcing. The recommended minimum length for the piControl is 500 years. To be performed with an Earth System Model (ESM) that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere.','f16fcc40-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL),(125,'piClim-control','Preindustrial conditions. An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology. Run for 30 years.','f16f2042-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(126,'land-cClim','Land surface model simulation.  Same as land-hist except with climate held constant. Branch from end of land-hist spin-up period and continue with spin-up forcing looping over the first 20 years of meteorological forcing data.  Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active. Start year either 1850 or 1700 depending on standard practice for particular model. This experiment can and likely will be a different configuration across models due to different representations of land use for each model.','6e2709b8-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(127,'hist-aer','Historical aerosol-only simulations resemble the historical simulations but instead are forced by changes in anthropogenic aerosol forcing only (sulfate, black carbon, organic carbon, ammonia, NOx and VOCs). Report what sets of emissions and boundary conditions are used.','f16d931c-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(128,'ssp370-ssp126Lu','Keep all forcings the same as ScenarioMIP SSP3-7.0 (deforestation scenario), but replace land use with SSP1-2.6 (aforestation) scenario.  Concentration driven.  Additional ensemble members are requested with tier 2 priority.','f16eeb04-dd9e-11e6-b89b-ac72891c3257','LUMIP',NULL,'01.00.28',NULL),(129,'dcppC-hindcast-noAgung','Prediction experiment without volcano forcing. Repeat DCCP-A1 1963 hindcast without Agung forcing. Background volcanic aerosol to be the same as that used in the 2015 forecast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.','f16e0090-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(130,'amip-hld','The topography of the highlands in Africa, N. America and S. America TP is modified by setting surface elevations to 500m. Other settings are the same as the standard DECK AMIP simulation. Minimum number of integrations is 1.','f16e2e30-dd9e-11e6-b89b-ac72891c3257','GMMIP',NULL,'01.00.28',NULL),(131,'piSST-pxK','An AGCM experiment with monthly-varying SSTs and sea-ice taken from each model\'s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run) but with a spatially and temporally uniform SST amomaly applied on top of the monthly-varying piSST-control SSTs.  The magnitude of the uniform increase is taken from each model\'s global, climatological annual mean SST change between abrupt4xCO2 and the piControl (using the mean of years 111-140 of abrupt4xCO2, and the parallel 30-year section of piControl).  Atmospheric constituents and any other necessary boundary conditions (e.g. vegetation if required) taken from each model\'s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run). Dynamic vegetation should be turned off and the vegetation distribution that is output from the piControl simulation used.','f16d76a2-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(132,'dcppC-ipv-neg','Restore the Pacific sea surface temperature to negative Pacific Decadal Variability (PDV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16ddc32-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(133,'amip-4xCO2','Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.5. AMIP conditions are imposed but the radiation code sees quadrupled CO2, relative to the AMIP. If the carbon cycle remains active, it should continue to \"see\" AMIP CO2, while the radiation should see 4xCO2 with respect to the AMIP experiment.','f16d4312-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(134,'modelSST-futArcSIC','Atmosphere-only time slice experiment to investigate the role of the background state. Time slice forced by future sea ice concentration (SIC) and present day sea surface temperature (SST) from the coupled model experiment pa-pdSIC (2.1) rather than from observations. Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa328-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(135,'land-noPasture','Land surface model simulation.  Same as land-hist except with grazing and other management on pastureland held at 1850 levels/distribution. i.e. all new pastureland treated as unmanaged grassland (as in land-crop-grass). Start year either 1850 or 1700 depending on standard practice for particular model. ','6e27146c-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(136,'amip-p4K','Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.8.  Add a uniform +4 K to the sea surface temperatures (SSTs) of the AMIP experiment. This warming should be applied to the ice free ocean surface only.  Sea ice and SSTs under sea ice remain the same as in the amip DECK experiment.','f16d3ef8-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(137,'hist-bgc','Historical, concentration-driven, simulation parallel to standard Historical run, but with radiative effects of CO2 disabled - i.e. the radiation code is fed the time-invariant CO2 concentration from the control run.','f16d2f3a-dd9e-11e6-b89b-ac72891c3257','C4MIP',NULL,'01.00.28',NULL),(138,'amip-future4K','Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.6. Add a composite SST warming pattern (derived from coupled models, scaled to a global mean of 4K) to the AMIP sea surface temperatures (SSTs). This warming should be applied to the ice free ocean surface only.  Sea ice and SSTs under sea ice remain the same as in the amip DECK experiment.  The patterned SST forcing dataset is available in a netcdf file called cfmip2_4k_patterned_sst_forcing.vn1.0.nc in the supplementary information for the CMIP6/CFMIP description paper (Webb et. al. 2016).','f16d45ce-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(139,'1pctCO2-bgc','Biogeochemically-coupled version of 1% per year increasing CO2 up to 4XCO2 simulation. CO2 increase only affects carbon cycle models, radiative code sees pre-industrial CO2. Nitrogen deposition held fixed at pre-industrial values.','f16bfe76-dd9e-11e6-b89b-ac72891c3257','C4MIP',NULL,'01.00.28',NULL),(140,'futureSST-4xCO2-solar','Time slice at year 100 of the GeoMIP G1 experiment with fixed sea surface temperature climatology calculated from the abrupt-4xCO2 experiment after 100 years. Run for 10 years.','f16e462c-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL),(141,'aqua-4xCO2','Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.7b. Aquaplanet (no land) experiment with CO2 set to 4x the AMIP mean concentration and no seasonal cycle.  Impose zonally uniform SSTs on a planet without continents.','f16d4f56-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(142,'land-hist-princeton','Land only simulations using Princeton forcing data and a standard bias correction strategy. As LUMIP land-hist but with princeton forcing dataset. The Princeton Global Forcing data is based on NCEP-NCAR reanalysis data. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.','f16eb0c6-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL),(143,'volc-cluster-mill','Parallel experiment to volc-cluster-ctrl but with initial conditions taken from last-millennium simulation to account for the effects of a more realistic history of past natural forcing.  Initialisation on 1 January 1790 to avoid interferences due to the decadal drop of solar activity associated with the Dalton Minimum.  The first eruption of the cluster begins in 1809 as in volc-cluster-ctrl. All external forcings, except volcanic forcing, are set as a perpetual repetition of the year 1790 for the full duration of the experiment. At least one, preferably three, ensemble members.  69 years for each ensemble member.','f16fa5b2-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(144,'piClim-NOx','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of NOx, all other emissions of tropospheric ozone precursors set to pre-industrial levels. This is a timeslice experiment of 30 years total.','70e432a2-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(145,'piClim-2xss','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The sea salt aerosol emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.','70e44742-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(146,'histSST-piO3','Historical atmosphere only simulation with historical WMGHG, transient historical SSTs.  Tropospheric ozone precursors fixed at 1850 emission levels.','70e3e6e4-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(147,'hist-sol','This experiment resembles hist-nat (histNat) except that simulations are driven by solar forcing only.','f16da636-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(148,'ssp126-ssp370Lu','Keep all forcings the same as ScenarioMIP SSP1-2.6 (aforestation scenario), but replace land use with SSP3-7.0 (deforestation) scenario.  Concentration driven.','f16ef1b2-dd9e-11e6-b89b-ac72891c3257','LUMIP',NULL,'01.00.28',NULL),(149,'amip-lfmip-pObs','Simulations with observed SST and land-hist output.  A \"pseudo-observed boundary condition\" experiment that uses AMIP SSTs and land boundary conditions generated by the land-hist experiment.','f16ec2dc-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL),(150,'piControl-spinup','A pre-industrial control spin-up simulation with non-evolving pre-industrial forcing. Forcing conditions are chosen to be representative of the period prior to the onset of large-scale industrialization, with 1850 being the reference year.  This experiment describes an initial climate spin-up, during which the climate begins to come into balance with the forcing. Run until at least the surface climate reaches equilibrium.','f16fd3b6-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL),(151,'lfmip-pdLC-princeton','Scenario forced experiment with prescribed land surface climatology derived from land-hist-princeton (1980-2014). The experiment is comprised of transient coupled atmosphere-ocean simulations in which a selection of land surface characteristics is prescribed rather than interactively calculated in the model.  The \"climatological\" land surface forcing is calculated as the mean annual cycle in the period 1980-2014 from the land-hist-princeton simulations.','623a9780-4cfc-11e7-903f-5404a60d96b5','LS3MIP',NULL,'01.00.28',NULL),(152,'ssp245-aer','An extension of at least one of the hist-aer (histAER) simulations to the year 2100 following SSP2-4.5 aerosol concentrations. Forced with aerosol and aerosol precursor emissions only (sulfate, black carbon, organic carbon, ammonia, NOx and VOCs).','f16dad48-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(153,'piClim-spAer-histall','A historical (1850-2014) experiment using an atmosphere-land model with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Transient forcing to be consistent with the historical forcing used in the DAMIP hist-all experiment but with RFMIP specified aerosol properties.','f16f4f54-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(154,'abrupt-solm4p','Same as abrupt-solp4p, except the solar constant is reduced by 4% rather than increased.','f16d66b2-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(155,'dcppC-atl-pacemaker','Restore 12-month running mean, anomalies of sea surface temperature in the north Atlantic. Outside the restored region the model evolves freely allowing full climate system response. Historical values of atmospheric composition/emissions and solar forcing. Time period: 1950-2014 (run from 1920 if possible). 10 ensemble members (up to 25 members requested).  SST signal may also be imposed by altering surface fluxes.','f16df2bc-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(156,'pa-futArcSIC-ext','Coupled ocean-atmosphere transient experiment.  Coupled model extended simulation constrained with present day sea ice.   Present day and future sea ice to be the same as used in experiment pdSST-futArcSIC (1.6).  It is recommended to constrain sea ice by nudging but with a weak relaxation timescale of 2 months. However, appropriately calibrated long-wave fluxes applied to the sea ice model may also be used.  Radiative forcing to be set to present day (year 2000) levels. Initial conditions for coupled model experiments to be taken from year 2000 of coupled model historical simulations.','661fa32c-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(157,'highresSST-smoothed','Similar to the HighResMIP highresSST-present experiment but with smoothed sea surface temperature (SST). Historical atmosphere-only simulations of the near past (1979-2014) using spatially filtered sea surface temperatures (SSTs). Use spatially low-pass filtered HadISST2.2 SSTs (Kennedy et al. 2017, in prep). The SST filter should be the LOESS filter used by Ma et al. (2015) and Chelton and Xie (2010). Run the experiment parallel to highresSST-present. At least one ensemble member at high resolution, minimum 25-50 km at mid-latitudes. Initial conditions from the highresSST-present experiment.','6532c92e-4cfe-11e7-903f-5404a60d96b5','HighResMIP',NULL,'01.00.28',NULL),(158,'dcppB-forecast','Ensembles of ongoing real-time 5-year forecsasts. Initialisation based on observations. Atmospheric composition and/or emissions (and other conditions including volcanic aerosols) to follow prescribed SSP2-4.5 forcing scenario. Run each member for 5 years, extend the duration to 10 years with Tier-2 priority. Additional ensemble members for each start date are requested with Tier-2 priority.','f16dc9d6-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(159,'hist-spAer-aer','A historical (1850-2014) experiment using a coupled AOGCM in which aerosol optical properties including cloud-radiation interactions are prescribed by RFMIP.  Aerosol forcings to be consistent with the historical forcing used in the DAMIP experiments. Only to be performed by models who are also running simulations for DAMIP.','f16f4536-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(160,'hist-CO2','Historical simulations driven by changes in CO2 concentration only as used in hist-all (histAll) experiment.','f16da8fc-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(161,'piClim-spAer-anthro','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology. Anthropogenic forcing agents are specified at present day 2014 values. Aerosols are specified by RFMIP. Run for 30 years.','f16f4842-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(162,'dcppC-ipv-NexTrop-neg','Restore the extra-tropical north Pacific sea surface temperature to negative Pacific Decadal Variability (PDV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16ded3a-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(163,'ssp370SST','SSP-based RCP scenario following approximately RCP7.0 global forcing pathway. SSP3 socioeconomic conditions.  Atmosphere only with SST from ScenarioMIP experiment SSP3-70.','70e3f9fe-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(164,'a4SSTice-4xCO2','As a4SSTice, but CO2 is quadrupled, and the increase in CO2 is seen by both the radiation scheme and vegetation.','f16d85c0-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(165,'ssp460','SSP-based RCP scenario with medium radiative forcing by the end of the century.  Following approximately RCP6.0 global forcing pathway with SSP4 socioeconomic conditions. Radiative forcing reaches a level of 6.0 W/m2 in 2100. Concentration-driven. ','f16f6476-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL),(166,'histSST','Historical atmosphere only simulation with historical forcings in an AGCM model with interactive aerosols.','70e3d12c-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(167,'pdSST-piAntSIC','Time slice forced by climatological monthly mean sea surface temperature (SST) for the present day sea and pre-industrial Antarctic sea ice concentration (SIC). Radiative forcing to be set to present day (year 2000) levels. Past SIC will be computed from the ensemble of CMIP5 simulations by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa31c-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(168,'land-crop-noIrrigFert','Land surface model simulation.  Same as land-hist except irrigated area and fertiliser area/use should be held constant at 1850 levels.  Irrigation amounts within the 1850 irrigated area are allowed to change.  Only relevant if land-hist utilises at least some form of crop management (e.g. planting and harvesting).  Start year either 1850 or 1700 depending on standard practice for particular model.','6e270e7c-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(169,'piClim-lu','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperature (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Land use is set to present day (2014) values, other forcing agents are specified at pre-industrial values.  Run for 30 years.','f16f2fe2-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(170,'volc-long-hlS','Idealised high-latitude (60S) southern hemisphere eruption corresponding to an initial emission of 28.1 Tg of SO2 (equal to half the total amount injected for volc-long-eq).  The experiment is designed to span very different initial climate states to systematically assess uncertainties in post-eruption behaviour that are related to background climate conditions.   If, for instance, year Y of the control integration matches the desired conditions for the initial condition sampling, then the corresponding VolMIP simulation should start with restart data from year Y-1 of the control.  Run nine ensemble members for at least 20 years, but preferably longer (50 years) to cover the multi-decadal oceanic response. Initialisation date from the piControl start year is 1st April.','f16fb3a4-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(171,'piClim-2xfire','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The fire aerosol emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.','70e44dc8-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(172,'ssp245-stratO3','Extension of stratospheric-ozone-only run, hist-stratO3, under SSP2-4.5 forcing to the year 2100. In models with coupled chemistry, he chemistry scheme should be turned off, and the simulated ensemble mean monthly mean 3D stratospheric ozone concentrations from the SSP2-4.5 simulations should be prescribed. Tropospheric ozone should be fixed at 3D long-term monthly mean piControl values, with a value of 100 ppbv ozone concentration in this piControl climatology used to separate the troposphere from the stratosphere.   In models without coupled chemistry the same stratospheric ozone prescribed in SSP2-45 should be prescribed. Stratospheric ozone concentrations will be provided by CCMI.','f16d9f60-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(173,'ssp370','Gap: Baseline scenario with a medium to high radiative forcing by the end of century. Following approximately RCP7.0 global forcing pathway with SSP3 socioeconomic conditions. Radiative forcing reaches a level of 7.0 W/m2 in 2100.  Concentration-driven.','f16f5ab2-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL),(174,'histSST-piAer','Historical atmosphere only simulation with historical WMGHG, transient historical SSTs.  Aerosol emissions (except NOx) fixed at 1850 emission levels.','70e3e34c-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(175,'land-hist','Land surface model simulation.  Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active. Forced with historical observed climate. Include all transient forcings that are relevant for the land model such as CO2 concentration, Nitrogen deposition, aerosol deposition, population density. Start year either 1850 or 1700 depending on standard practice for particular model. This experiment is shared with the LS3MIP, note that LS3MIP expects the start year to be 1850. This experiment can and likely will be a different configuration across models due to different representations of land use for each model.','f16eaa36-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL),(176,'lgm','Impose Last Glacial Maximum (21 kyr ago) boundary conditions for ice-sheet and land-sea mask, the atmospheric concentration of well-mixed greenhouse gases and orbital parameters.  Run for at least 100 years after spin-up. It is mandatory that the model versions used for the PMIP-CMIP6 experiments are the exactly the same as for the other CMIP6 experiments, in particular the DECK and historical simulations.','f16f0242-dd9e-11e6-b89b-ac72891c3257','PMIP',NULL,'01.00.28',NULL),(177,'hist-spAer-all','A historical (1850-2014) experiment using a coupled AOGCM in which aerosol optical properties including cloud-radiation interactions are prescribed by RFMIP.  Other forcings to be consistent with the historical forcing used in the DAMIP experiments.  One ensemble member required for RFMIP.  Four ensemble members required for inclusion in DAMIP.','f16f3fbe-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(178,'esm-ssp585','Emission driven future scenario (SSP-based RCP SSP5-8.5) up to 2100. Starting conditions taken from emissions-driven Historical simulation.','f16c8fe4-dd9e-11e6-b89b-ac72891c3257','C4MIP',NULL,'01.00.28',NULL),(179,'pa-futAntSIC-ext','Coupled ocean-atmosphere transient experiment.  Coupled model extended simulation constrained with present day sea ice.   Present day and future sea ice to be the same as used in experiment pdSST-futAntSIC (1.8).  It is recommended to constrain sea ice by nudging but with a weak relaxation timescale of 2 months. However, appropriately calibrated long-wave fluxes applied to the sea ice model may also be used.  Radiative forcing to be set to present day (year 2000) levels. Initial conditions for coupled model experiments to be taken from year 2000 of coupled model historical simulations.','661fa32d-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(180,'pa-futArcSIC','Coupled ocean-atmosphere time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day and future Actic sea ice concentration (SIC). Sea ice concentration to be nudged into coupled model with a relaxation time-scale of 1 day. Radiative forcing to be set to present day (year 2000) levels.  Initial conditions for coupled model experiments to be taken from year 2000 of coupled model CMIP6 historical simulations. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa322-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(181,'esm-hist','Simulation of recent past (1850 to 2014) with atmospheric CO2 concentration calculated. Impose changing conditions (consistent with observations). To be performed with an Earth System Model (ESM) that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere.','f16fc9ac-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL),(182,'midPliocene-eoi400','Impose Mid-Pliocene Warm Period (3.2 Ma ago) boundary conditions for ice sheet and land-sea mask, topography (smaller ice sheets),  the atmospheric concentration of well-mixed greenhouse gases and orbital parameters.  Run for at least 100 years after spin-up. It is mandatory that the model versions used for the PMIP-CMIP6 experiments are the exactly the same as for the other CMIP6 experiments, in particular the DECK and historical simulations.','f16f0f30-dd9e-11e6-b89b-ac72891c3257','PMIP',NULL,'01.00.28',NULL),(183,'ism-1pctCO2to4x-std','Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for the idealised 1% per year atmospheric carbon dioxide increase to quadrupling and held fixed climate change experiment.','f16e7ef8-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(184,'ssp370SST-lowNTCF','SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced NTCF emissions. SSP3 socioeconomic conditions.  Atmosphere only with SST from ScenarioMIP experiment SSP3-70.','70e3fec2-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(185,'lfmip-rmLC-wfdei','Scenario forced experiment with prescribed land surface climatology derived from transient 30 year running mean from land-hist-wfdei.  ','7d84dd02-4cfc-11e7-903f-5404a60d96b5','LS3MIP',NULL,'01.00.28',NULL),(186,'historical-withism','Historical experiment with interactive ice sheet model.  The experiment should be identical to the corresponding standard CMIP AOGCM experiment except for the treatment of ice sheets.','f16e8524-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(187,'futSST-pdSIC','Atmosphere-only time slice experiment forced by climatological monthly mean sea ice concentration (SIC) for the present day and future sea surface temperature (SST) representing 2 degree global warming.  Radiative forcing to be set to present day (year 2000) levels. Future SST will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa319-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(188,'deforest-globe','Idealized deforestation experiment. 20 million square km forest area (covered by trees) is converted to natural unmanaged grassland over a period of 50 years with a linear rate of 400000 km2/yr followed by 30 years of constant forest cover. Run for 80 years. Simulations should be branched from an 1850 control simulation (piControl) at least 80 years prior to the end of the piControl simulation so that deforest-globe and piControl can be directly compared.  All pre-industrial forcings including CO2 concentration and land-use maps and land management should be maintained as in the piControl.  Deforestation should be restricted to the top 30% of land grid cells in terms of their area of tree cover.  Effectively this concentrates deforestation in the tropical rainforest and boreal forest regions.','f16ed18c-dd9e-11e6-b89b-ac72891c3257','LUMIP',NULL,'01.00.28',NULL),(189,'dcppC-forecast-addPinatubo','Prediction experiment for 2015 with volcano forcing.  Repeat DCPP-A1 2015 forecast (from the dcppA-hindcast experiment) with Pinatubo forcing. Background volcanic aerosol to be the same as that used in the 1991 hindcast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.','f16fab98-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(190,'dcppC-amv-ExTrop-pos','Restore the extra-tropical north Atlantic sea surface temperature to positive Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members.  SST signal may also be imposed by altering surface fluxes.','f16ddeb2-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(191,'1pctCO2Ndep','Fully-coupled concentration driven 1% per year increasing CO2 up to 4XCO2 simulation with time varying nitrogen deposition.  Only applicable to models whose simulation will be affected by the deposition of reactive nitrogen either due to terrestrial or marine nitrogen cycle effects on carbon fluxes and store.','f16d2c2e-dd9e-11e6-b89b-ac72891c3257','C4MIP',NULL,'01.00.28',NULL),(192,'histSST-piN2O','Historical atmosphere only simulation with historical  forcings but with nitrous oxide (N2O) fixed at 1850 concentration levels. ','70e3f198-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(193,'piControl-withism','The pre-industrial control in a model with interactive ice sheet model.   The experiment should be identical to the corresponding standard CMIP AOGCM experiment except for the treatment of ice sheets. The spin up may require the GCM and ISM to be asynchronously coupled until the system reaches quasi-equilibrium. Once equilibrium is reached, run for multi-hundred years (500 years suggested). ','f16e6d50-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(194,'aqua-control-lwoff','Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.7a. Aquaplanet (no land) experiment with CO2 set to the AMIP mean concentration and no seasonal cycle.  Impose zonally uniform SSTs on a planet without continents but with cloud-radiative effects switched off in the LW radiation code.','f16d5be0-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(195,'highres-future','High forcing (ScenarioMIP SSP5-85) future scenario (2015-2050) coupled ocean atmosphere simulations at high and standard resolution. For optimal comparison between models aerosol concentrations are recommended (rather than emissions). At least one ensemble member at high resolution, minimum atmosphere 25-50 km at mid-latitudes and ocean resolution of 0.25 degrees, and a minimum of daily coupling between ocean and atmosphere. At least one ensemble member at standard model resolution.','6131bd34-4cff-11e7-903f-5404a60d96b5','HighResMIP',NULL,'01.00.28',NULL),(196,'hist-volc','This experiment resembles hist-nat (histNat) except that simulations are driven by volcanic forcing only.','f16da23a-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(197,'hist-all-nat2','Very like the hist-all (histALL) simulations except that they contain alternative estimates of solar and volcanic forcing.','f16db7e8-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(198,'hist-noLu','Concentration driven historical forcing with land use held constant at 1850 usage.  Same as the concentration driven CMIP6 historical experiment except with land use and land cover change (LULCC) held constant at pre-industrial conditions. Additional ensemble members are requested with tier 2 priority.','f16ee46a-dd9e-11e6-b89b-ac72891c3257','LUMIP',NULL,'01.00.28',NULL),(199,'pdSST-futOkhotskSIC','Atmosphere-only time slice experiment to investigate regional forcing. Time slice forced by climatological monthly mean sea surface temperature (SST) for the present day and future Arctic sea ice concentration (SIC) only in the Sea of Okhotsk. Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa325-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(200,'lfmip-rmLC-princeton','Scenario forced experiment with prescribed land surface climatology derived from transient 30 year running mean from land-hist-princeton.  ','7d84dbae-4cfc-11e7-903f-5404a60d96b5','LS3MIP',NULL,'01.00.28',NULL),(201,'G7SST2-cirrus','Time slice at year 2100 GeoMIP G7cirrus.  Run for 10 years.','f16e5446-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL),(202,'ism-ssp585-self','Stand alone ice sheet model driven offline by a CMIP6 model with scenarioMIP SSP5-85 forcing.  The ice sheet model should be configured with the same settings as the ice sheet model in the ssp585-withism experiment and should use the same initial conditions.','f16e93ca-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(203,'ism-ctrl-std','Offline ice sheet control run for the ISMIP6 InitMIP experiments. A stand-alone ice sheet model is initialized using a modelling groups\' own initialisation technique.  ism-ctrl-std is an unforced forward experiment where the surface mass balance remains identical to the one used during the initialization procedure. The choice of model input data is unconstrained to allow participants the use of their preferred model setup without modification. ','f16ea13a-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(204,'aqua-control','Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.7a. Aquaplanet (no land) experiment with CO2 set to the AMIP mean concentration and no seasonal cycle.  Impose zonally uniform SSTs on a planet without continents.','f16d49c0-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(205,'volc-cluster-ctrl','Early 19th century cluster of strong tropical volcanic eruptions, including the 1809 event of unknown location, and the 1815 Tambora and 1835 Cisuguina eruptions.  Run three ensemble members for at least 50 years to cover the multi-decadal oceanic response and to assess stationarity of post-cluster climate.','f16f9c20-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(207,'volc-pinatubo-strat','1991 Pinatubo forcing is expressed with a prescribed perturbation to the total (LW+SW) radiative heating rates. Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. Requires special diagnostics of parameterised and resolved wave forcings, radiative and latent heating rates. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions. Sampling of an eastern phase of the Quasi-Biennial Oscillation (QBO), as observed after the 1991 Pinatubo eruption is preferred for those models that spontaneously generate such mode of stratospheric variability. Run at least 25 ensemble members for 3 years. ','f16f97b6-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(208,'G6sulfur','Injection of sulfate aerosol precursors in the equatorial stratosphere to reduce the radiative forcing of the ScenarioMIP high forcing scenario (SSP5-85) to match that of the ScenarioMIP medium forcing scenario (SSP2-45).   Geoengineering will be simulated over years 2020 to 2100.','f16e3632-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL),(209,'G6SST2-solar','Time slice at year 2100 of GeoMIP G6solar. Run for 10 years.','f16e4ed8-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL),(210,'ssp534-over-bgc','Biogeochemically-coupled version of the mitigated overshoot scenario with medium/low radiative forcing by the end of the 21st century.  The scenario follows SSP5-8.5, an unmitigated baseline scenario, through 2040, and then substantially negative net emissions thereafter.','f16d393a-dd9e-11e6-b89b-ac72891c3257','C4MIP',NULL,'01.00.28',NULL),(211,'dcppC-forecast-addElChichon','Prediction experiment for 2015 with volcano forcing.  Repeat DCPP-A1 2015 forecast (from the dcppA-hindcast experiment) with El Chichon forcing. Background volcanic aerosol to be the same as that used in the 1992 hindcast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.','f16e06c6-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(212,'dcppC-amv-neg','Restore the north Atlantic sea surface temperature to negative Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16dd49e-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(213,'dcppC-pac-pacemaker','Restore to observed anomalies of sea surface temperature in the tropical eastern Pacific. Outside the restored region the model evolves freely allowing full climate system response. Historical values of atmospheric composition/emissions and solar forcing. Time period: 1950-2014 (run from 1920 if possible). 10 ensemble members.  SST signal may also be imposed by altering surface fluxes.','f16defec-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(214,'ssp585-withism','ScenarioMIP SSP5-85 forcing in a model with interactive ice sheets. The set up follows the set up for the standard ScenarioMIP SSP5-85, which may therefore first require the CMIP6 Historical simulation to be performed too with a coupled AOGCM-ISM setting.','f16e8fb0-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(215,'highresSST-p4K','Similar to the CFMIP amip-p4K experiment but with a uniform warming of 4K added to the sea surface temperatures (SSTs).  Historical atmosphere-only simulations of the near past (1979-2014). Use HadISST2.2 sea surface temperature and sea ice concentrations at daily 1/4 degree resolution with a uniform warming of 4K added to SSTs (Kennedy et al. 2017, in prep).  Run the experiment parallel to highresSST-present. At least one ensemble member at high resolution, minimum 25-50 km at mid-latitudes. Initial conditions from the highresSST-present experiment.','6532c802-4cfe-11e7-903f-5404a60d96b5','HighResMIP',NULL,'01.00.28',NULL),(216,'pa-piArcSIC','Coupled ocean-atmosphere time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day and pre-industrial Actic sea ice concentration (SIC). Sea ice concentration to be nudged into coupled model with a relaxation time-scale of 1 day. Radiative forcing to be set to present day (year 2000) levels.  Initial conditions for coupled model experiments to be taken from year 2000 of coupled model CMIP6 historical simulations. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa321-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(217,'dcppC-hindcast-noPinatubo','Prediction experiment without volcano forcing. Repeat DCCP-A1 1991 hindcast without Pinatubo forcing. Background volcanic aerosol to be the same as that used in the 2015 forecast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.','f16df9d8-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(218,'piClim-BC','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial tropospheric ozone precursors, present day (2014) emissions of black carbon (BC) and pre-industrial emissions of all other aersols and aerosol precursors.  This is a timeslice experiment of 30 years total.','70e41b82-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(219,'piClim-histnat','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Transient natural forcing (solar and volcano) to be consistent with historical forcing used in the DAMIP hist-all experiment and future forcing used in the ScenarioMIP SSP2 RCP4.5 scenario.  A small ensemble of three simulations from 1850-2100.','f16f36f4-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(220,'lfmip-initLC','\"pseudo-observed boundary condition\" experiment that uses that uses batch offline land models (in line with the GLACE2 set-up) to initialize historical runs with prescribed reconstructed land surface states, either derived from offline simulations or from various observational data sources.','f16ecd9a-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL),(221,'a4SST','As piSST, but with monthly-varying SSTs taken from years 111-140 of each model\'s own abrupt4xCO2 experiment instead of from piControl. Sea-ice is unchanged from the piSST.','f16d8070-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(222,'pdSST-futArcSICSIT','Atmosphere-only time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day, future Arctic sea ice concentration (SIC) and future Arctic sea ice thickness (SIT). Radiative forcing to be set to present day (year 2000) levels. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa31f-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(223,'ism-historical-std','Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for the historical climate experiment. This is an abbreviated experiment for the historical period which begins from the present day control and ends in December 2014.','f16e8ce0-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(224,'dcppC-atl-control','Restore the north Atlantic sea surface temperature to the model control run climatology. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16dcdf0-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(225,'pa-pdSIC','Coupled ocean-atmosphere time slice present day control experiment constrained by oberved sea ice.  Coupled model time slice constrained by climatological monthly mean sea surface temperature (SST) and sea ice concentration (SIC) for the present day.  Sea ice concentration to be nudged into coupled model with a relaxation time-scale of 1 day. Radiative forcing to be set to present day (year 2000) levels. Initial conditions for coupled model experiments to be taken from year 2000 of coupled model CMIP6 historical simulations. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa320-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(226,'highresSST-present','Historical atmosphere-only simulations of the near past (1950-2014). HadISST2.2 sea surface temperature and sea ice concentrations at daily 1/4 degree resolution to be used (Kennedy et al. 2017, in prep).  For optimal comparison between models the use of plume aerosol cocentrations are recommended (rather than emissions). At least one ensemble member at high resolution, minimum 25-50 km at mid-latitudes. At least one ensemble member at standard model resolution as used in the DECK and historical simulations. Initial conditions from either the ERA-20C reanalysis (and then some intial spinup), or a suitably spun-up atmosphere-land initial condition reflecting 1950\'s conditions.','f16e618e-dd9e-11e6-b89b-ac72891c3257','HighResMIP',NULL,'01.00.28',NULL),(227,'historical-ext','Extension beyond 2014 of the CMIP6 historical simulation.','f16fcec0-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL),(228,'pa-pdSIC-ext','Coupled ocean-atmosphere transient experiment.  Coupled model extended simulation constrained with present day sea ice.   Present day sea ice to be the same as used in experiment pdSST-pdSIC (1.1).  It is recommended to constrain sea ice by nudging but with a weak relaxation timescale of 2 months. However, appropriately calibrated long-wave fluxes applied to the sea ice model may also be used.  Radiative forcing to be set to present day (year 2000) levels. Initial conditions for coupled model experiments to be taken from year 2000 of coupled model historical simulations.','661fa32b-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(229,'piSST','An AGCM experiment with monthly-varying SSTs, sea-ice, atmospheric constituents and any other necessary boundary conditions (e.g. vegetation if required) taken from each model\'s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run).  Dynamic vegetation should be turned off in all the piSST set of experiments and the vegetation distribution that is output from the piControl simulation used.','f16d718e-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(230,'highresSST-4xCO2','Similar to the CFMIP amip-4xCO2 experiment but with CO2 concentations quadrupled. Historical atmosphere-only simulations of the near past (1979-2014).  HadISST2.2 sea surface temperature and sea ice concentrations at daily 1/4 degree resolution to be used (Kennedy et al. 2017, in prep). The CO2 concentration seen by the radiation scheme is quadrupled with respect to the CMIP6 amip experiment. If the carbon cycle remains active, it should continue to \"see\" highresSST-present CO2 concentrations.  For optimal comparison between models the use of plume aerosol cocentrations are recommended (rather than emissions). At least one ensemble member at high resolution, minimum 25-50 km at mid-latitudes. Initial conditions from the highresSST-present experiment.','6532c230-4cfe-11e7-903f-5404a60d96b5','HighResMIP',NULL,'01.00.28',NULL),(231,'omip1','Global ocean/sea-ice/inert-chemical/biogeochemical experiment.  Run for a minimum of five repeating cycles of the CORE-II forcing. Groups that are unable to run with biogeochemistry can participate in the physical/chemical portion.','fed778d4-4d00-11e7-903f-5404a60d96b5','OMIP',NULL,'01.00.28',NULL),(232,'omip2','Global ocean/sea-ice/inert-chemical/biogeochemical experiment.  This experiment will use atmospheric state and runoff data based on the JRA-55 reanalysis inter-annually varying atmospheric and river data sets for years 1958-2016 (Kobayashi et al., 2015).   Initial ocean tracer fields are based on observations.','fe6e64fc-4d00-11e7-903f-5404a60d96b5','OMIP',NULL,'01.00.28',NULL),(233,'ssp119','SSP-based RCP scenario with very-low forcing by the end of the century.  Following approximately RCP1.9 global forcing pathway with SSP1 socioeconomic conditions. Radiative forcing reaches a level of 1.9 W/m2 in 2100. Concentration-driven. ','f16f77c2-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL),(234,'amip-a4SST-4xCO2','Same as amip, but a patterned SST anomaly is applied on top of the monthly-varying amip SSTs. This anomaly is a monthly climatology, taken from each model\'s own abrupt4xCO2 run minus piControl (using the mean of years 111-140 of abrupt4xCO2, and the parallel 30-year section of piControl). CO2 is quadrupled, and the increase in CO2 is seen by both the radiation scheme and vegetation.','f16d8854-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(235,'hist-nat','Historical natural-only simulations resemble the historical simulations but instead are forced with only solar and volcanic forcing from the historical simulations. Report what sets of emissions and boundary conditions are used.','f16d8b56-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL),(236,'1pctCO2-rad','Radiatively-coupled version of 1% per year increasing CO2 up to 4XCO2 simulation. CO2 increase only affects the radiative code, carbon cycle models see pre-industrial CO2. Nitrogen deposition held fixed at pre-industrial values.','f16d1d60-dd9e-11e6-b89b-ac72891c3257','C4MIP',NULL,'01.00.28',NULL),(237,'land-noWoodHarv','Land surface model simulation. Same as land-hist except with wood harvest maintained at 1850 amounts/areas.  Start year either 1850 or 1700 depending on standard practice for particular model.','6e2716ce-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(238,'volc-pinatubo-surf','1991 Pinatubo forcing is expressed with a prescribed perturbation to the shortwave flux to mimic the attenuation of solar radiation by volcanic aerosols and therefore the cooling of the surface. Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. Requires special diagnostics of parameterised and resolved wave forcings, radiative and latent heating rates. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions. Sampling of an eastern phase of the Quasi-Biennial Oscillation (QBO), as observed after the 1991 Pinatubo eruption is preferred for those models that spontaneously generate such mode of stratospheric variability. Run ','f16f93b0-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(239,'a4SSTice','As piSST, but with monthly-varying SSTs and sea ice taken from years 111-140 of each model\'s own abrupt4xCO2 experiment instead of from piControl.','f16d832c-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(240,'land-hist-cruNcep','Land only simulations using CRU-NCEP forcing data and a standard bias correction strategy. As LUMIP land-hist but with CRU-NCEP dataset. CRU-NCEP is a forcing dataset in which NCEP reanalysis data are bias corrected using the gridded in situ climate data form the Climate Reserach Unit (CRU). The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.','f16eae14-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL),(241,'amip-piForcing','AMIP experiment (with SSTs and Sea Ice the same as in the amip experiment in the DECK) but with constant pre-industrial forcing levels (anthropogenic & natural) and run from 1870-present.','f16d6e64-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(242,'esm-piControl-spinup','A pre-industrial control spin-up simulation with non-evolving pre-industrial forcing and atmospheric CO2 calculated. Conditions chosen to be representative of the period prior to the onset of large-scale industrialization, with 1850 being the reference year.  This experiment describes an initial climate spin-up, during which the climate begins to come into balance with the forcing.  To be performed with an Earth System Model (ESM) that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere.  Run until Earth System reaches equilibrium.','f16fd636-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL),(243,'lfmip-rmLC-cruNcep','Scenario forced experiment with prescribed land surface climatology derived from transient 30 year running mean from land-hist-cruNcep.  ','7d84d87a-4cfc-11e7-903f-5404a60d96b5','LS3MIP',NULL,'01.00.28',NULL),(244,'piClim-2xdust','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The dust aerosol emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.','70e443f0-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(245,'dcppC-forecast-addAgung','Prediction experiment for 2015 with volcano forcing.  Repeat DCPP-A1 2015 forecast (from the dcppA-hindcast experiment) with Agung forcing. Background volcanic aerosol to be the same as that used in the 1963 hindcast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.','f16e0978-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(246,'dcppC-amv-Trop-pos','Restore the tropical north Atlantic sea surface temperature to positive Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members.  SST signal may also be imposed by altering surface fluxes.','f16de40c-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL),(247,'piClim-NTCF','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases) and present day (2014) emissions of NTCF (near-term climate forcers). This is a timeslice experiment of 30 years total.','70e417f4-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(248,'ssp534-over','Gap: Mitigated overshoot scenario with medium/low radiative forcing by the end of the 21st century.  The scenario follows SSP5-8.5, an unmitigated baseline scenario, through 2040, and then substantially negative net emissions thereafter.','f16f73f8-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL),(249,'land-noFire','Land surface model simulation. Same as land-hist except with fire management maintained at 1850 levels. Start year either 1850 or 1700 depending on standard practice for particular model.','6e27132c-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(250,'omip2-spunup','Global ocean/sea-ice/inert-chemical/biogeochemical experiment.  Rather than using observed climatologies to initialise the biogeochemistry as in omipv2, this simulation will be initialised with model tracer fields that have been spun up for at least 2000 years, ideally for 5000 years.  The omipv2-spunup simulations (and spin-ups) will include radiocarbon (abiotic DIC and DI14C). Atmospheric forcing follows JRA-55, inert chemical tracers follow OCMIP2, and biogeochemical tracers follow OCMIP3. Only for modelling groups that have biogeochemistry and are able to afford a millennial-scale spin-up.','fe6e67f4-4d00-11e7-903f-5404a60d96b5','OMIP',NULL,'01.00.28',NULL),(251,'piClim-2xNOx','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The lightning NOx (oxides of nitrogen) emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.','70e45430-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(252,'piClim-spAer-histaer','A historical (1850-2014) experiment using an atmosphere-land model with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Transient aerosol forcing specified by RFMIP, other forcing agents are set at pre-industrial levels.','f16f53aa-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(253,'lfmip-pdLC-cruNcep','Scenario forced experiment with prescribed land surface climatology derived from land-hist-cruNcep (1980-2014). The experiment is comprised of transient coupled atmosphere-ocean simulations in which a selection of land surface characteristics is prescribed rather than interactively calculated in the model.  The \"climatological\" land surface forcing is calculated as the mean annual cycle in the period 1980-2014 from the land-hist-cruNcep simulations.','623a9b2c-4cfc-11e7-903f-5404a60d96b5','LS3MIP',NULL,'01.00.28',NULL),(254,'piClim-O3','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors and present day (2014) tropospheric ozone precursors. This is a timeslice experiment of 30 years total.','70e42528-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(255,'histSST-piNTCF','Historical atmosphere only simulation with historical WMGHG, transient historical SSTs.  NTCFs fixed at 1850 emission levels.','70e3df14-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(256,'land-crop-noFert','Land surface model simulation.  Same as land-hist except with fertilisation area held at 1850 levels/distribution. Only relevant if land-hist utilises at least some form of crop management (e.g. planting and harvesting).  Start year either 1850 or 1700 depending on standard practice for particular model.','6e270c1a-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL),(257,'pdSST-pdSICSIT','Atmosphere-only time slice present day control experiment with sea ice thickness.  Time slice forced by climatological monthly mean sea surface temperature (SST), sea ice concentration (SIC) and sea ice thickness (SIT) for the present day.  Radiative forcing to be set to present day (year 2000) levels. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa31e-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(258,'piClim-histaer','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Apply transient aerosols and their indirect effects consistent with historical forcing used in the DAMIP hist-all experiments and future forcing in the ScenarioMIP SSP2 RCP8.5 scenario.  A small ensemble of three simulations from 1850-2100.','f16f39ec-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(259,'histSST-piCH4','Historical atmosphere only simulation with historical forcings but with methane fixed at 1850 concentration levels. ','70e3edf6-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(260,'aqua-p4K-lwoff','Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.7c. Aquaplanet (no land) experiment with CO2 set to the AMIP mean concentration and no seasonal cycle.  Impose a uniform +4K perturbation to the zonally uniform SSTs of the aquaControl, on a planet without continents but with cloud-radiative effects switched off in the LW radiation code.','f16d60f4-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL),(261,'land-noLu','Land surface model simulation. Historical forcing with land use held constant at 1850. Same as land-hist except no land use change.  Include representation of land cover, land use and land management. All applicable land use features should be active. Forced with historical observed climate. Include transient CO2, Nitrogen deposition, aerosol deposition etc. Start year either 1850 or 1700 depending on standard practice for particular model. This experiment is shared with the LS3MIP, note that LS3MIP expects the start year to be 1850. This experiment can and likely will be a different configuration across models due to different representations of land use for each model.','f33153f2-69a0-11e8-80de-a44cc8186c64','LUMIP',NULL,'01.00.28',NULL),(262,'land-hist-wfdei','Land only simulations using WFDEI forcing data and a standard bias correction strategy. As LUMIP land-hist but with WFDEI dataset. WFDEI: WATCH Forcing Data methodology applied to ERA-Interim reanalysis data. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.','f16eb364-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL),(263,'pa-futAntSIC','Coupled ocean-atmosphere time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day and future Antarctic sea ice concentration (SIC). Sea ice concentration to be nudged into coupled model with a relaxation time-scale of 1 day. Radiative forcing to be set to present day (year 2000) levels.  Initial conditions for coupled model experiments to be taken from year 2000 of coupled model CMIP6 historical simulations. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa324-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(264,'modelSST-pdSIC','Atmosphere-only time slice experiment to investigate the role of the background state. Time slice forced by present day sea ice concentration (SIC) and present day sea surface temperature (SST) from the coupled model experiment pa-pdSIC (2.1) rather than from observations. Radiative forcing to be set to present day (year 2000) levels. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa327-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(265,'G7SST1-cirrus','Time slice at year 2020 of GeoMIP G7cirrus. Run for 10 years.','f16e5194-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL),(266,'ssp370SST-lowO3','SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced tropospheric ozone precursors (not methane). SSP3 socioeconomic conditions. Atmosphere only with SST from experiment SSP3-70.','70e408f4-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(267,'piClim-4xCO2','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology. Carbon Dioxide concentrations set to 4 times Pre-Industrial values, other forcing agents are specified at pre-industrial values. Run for 30 years.','f16f2484-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL),(268,'hist-1950HC','Historical WMGHG concentrations and historical emissions of Near Term Climate Forcers (NTCFs), namely tropospheric aerosols and tropospheric ozone precursors, halocarbons (Ozone Depleting Substances) to be fixed at 1950 concentration levels. These simulations parallel the \"CMIP6 historical\", and differ only by fixing the anthropogenic emissions or concentrations of a specified class of species.   All other forcing agents must evolve as in \"CMIP6 historical\".','70e37934-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL),(269,'1pctCO2-4xext','Branched from the 1pctCO2 simulation at year 140 and run with CO2 fixed at 4x pre-industrial concentration.','f16e8272-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL),(270,'volc-pinatubo-full','1991 Pinatubo forcing as used in the CMIP6 historical simulations.  Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. Requires special diagnostics of parameterised and resolved wave forcings, radiative and latent heating rates. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions. Sampling of an eastern phase of the Quasi-Biennial Oscillation (QBO), as observed after the 1991 Pinatubo eruption is preferred for those models that spontaneously generate such mode of stratospheric variability. Run at least 25 ensemble members for 3 years. ','f16f8f50-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL),(271,'amip','An atmosphere only climate simulation using prescribed sea surface temperature and sea ice concentrations but with other conditions as in the Historical simulation.','f16fc344-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL),(272,'piSST-piSIC','Atmosphere-only time slice pre-industrial control experiment forced by climatological monthly mean sea surface temperature (SST) and sea ice concentration (SIC) for pre-industrial conditions. Radiative forcing to be set to present day (year 2000) levels. Past SIC and SST will be computed from the ensemble of CMIP5 simulations by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa317-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL),(273,'4xCO2-CESM2-BGC','Abrupt 4xCO2 run','f16fbe1c-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.26',4),(274,'4xCO2-CESM2-WACCM','Abrupt 4xCO2 run','f16fbe1c-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.26',4),(275,'Control','Pre-industrial control simulation','f16fb9da-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.26',1),(276,'Control-WACCM','Pre-industrial control simulation with WACCM','f16fb9da-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.26',1),(277,'Control-high-res','Pre-industrial control simulation at high resolution (CESM2 SE 1/4-degree)','f16fb9da-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.26',1),(278,'1pctCO2-CESM2-BGC','1%/yr CO2 increase up to 4x','f16fc0b0-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.26',2),(279,'1pctCO2-CESM2-WACCM','1%/yr CO2 increase up to 4x','f16fc0b0-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.26',2),(280,'historical-WACCM','Historical simulation using CMIP6 and WACCM forcings (1850-2014)','f16fc5c4-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.26',3),(281,'AMIP-CESM2-BGC','AMIP simulation (~1979-2014)','f16fc344-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.26',5),(282,'AMIP-CESM2-WACCM','AMIP simulation (~1979-2014)','f16fc344-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.26',5),(283,'hist-nat-WACCM','Historical natural-only simulations resemble the historical simulations but instead are forced with only solar and volcanic forcing from the historical simulations. Report what sets of emissions and boundary conditions are used.','f16d8b56-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.26',NULL),(284,'hist-GHG-WACCM','Historical greenhouse-gas only simulations resemble the historical simulations but instead are forced by well-mixed greenhouse gas changes only. Models with interactive chemistry schemes should either turn off the chemistry or use a preindustrial climatology of stratospheric and tropospheric ozone in their radiation schemes.  This will ensure that ozone is fixed in all these simulations, and simulated responses in models with and without coupled chemistry are comparable. Report what sets of emissions and boundary conditions are used.','f16d8f5c-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.26',NULL),(285,'ssp585-WACCM','SSP-based RCP scenario with high radiative forcing by the end of century. Following approximately RCP8.5 global forcing pathway with SSP5 socioeconomic conditions. Concentration-driven.','f16f5684-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.26',NULL),(286,'ssp370-WACCM','Gap: Baseline scenario with a medium to high radiative forcing by the end of century. Following approximately RCP7.0 global forcing pathway with SSP3 socioeconomic conditions. Radiative forcing reaches a level of 7.0 W/m2 in 2100.  Concentration-driven.','f16f5ab2-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.26',NULL),(287,'ssp245-WACCM','SSP-based RCP scenario with medium radiative forcing by the end of the century.  Following approximately RCP4.5 global forcing pathway with SSP2 socioeconomic conditions. Radiative forcing reaches a level of 4.5 W/m2 in 2100. Concentration-driven.','f16f5da0-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.26',NULL),(288,'ssp126-WACCM','SSP-based RCP scenario with low radiative forcing by the end of the century.  Following approximately RCP2.6 global forcing pathway with SSP1 socioeconomic conditions. Radiative forcing reaches a level of 2.6 W/m2 in 2100. Concentration-driven.','f16f6188-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.26',NULL),(289,'esm-yr2010CO2-control','Forced with CO2 emissions diagnosed from historical and yr2010CO2 simulations and all other forcings the same as in that simulation (part of the CDR-yr2010-pulse experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). In this experiment CO2 is first prescribed to diagnose emissions; however, the key simulations calculate the CO2 concentration.','56ed15ca-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(290,'land-ssp126','Offline land surface simulations forced with ScenarioMIP SSP1-26.  Three realisations required.  A trend preserving statistical bias correction method is applied to 3-hourly surface meteorological variables from the scenario output to generate a set of ensemble forcing data.  Gridded forcings will be provided by LS3MIP. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.','7c2bb5fe-c8a0-11e8-8bae-a44cc8186c64','LS3MIP',NULL,'01.00.28',NULL),(291,'esm-yr2010CO2-noemit','Upon initialization from end of year 2015 of esm-yr2010-control CO2 emissions are fixed at zero; all other forcing fixed at 2010 level (part of the CDR-yr2010-pulse experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). In this experiment CO2 is first prescribed to diagnose emissions; however, the key simulations calculate the CO2 concentration.','56ed15d4-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(292,'esm-ssp585-ocn-alk','emission driven SSP5-8.5 scenario with 0.14 Pmol/yr alkalinity added to ice free ocean surface waters from 2020 optionally extended from 2100 to 2300 (part of the CDR-ocean-alk experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).','56ed15cb-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(293,'1pctCO2-cdr','1 percent per year decrease in CO2 (immediately after reaching 4xCO2 in the 1pctCO2 simulation); then held constant at pre-industrial level for as long as possible (part of the CDR-reversibility experiment). CO2 concentration prescribed.','56ed15cc-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(294,'esm-pi-CO2pulse','100 Gt C instantly added (positive pulse) to a pre-industrial atmosphere (part of the CDR-pi-pulse experiment). CO2 concentration calculated (i.e. freely evolving).','56ed15cd-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(295,'esm-ssp585ext','Long term extension of CO2 emissions driven SSP5-8.5 scenario (used in the CDR-afforestation and CDR-ocean-alk experiments). All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).','56ed15cf-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(296,'esm-ssp585-ssp126Lu-ext','Long term extension of CO2 emissions driven SSP5-8.5 with SSP1-2.6 land use forcing (part of the CDR-afforestation experiment). All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). ','56ed15d0-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(297,'esm-pi-cdr-pulse','100 Gt C instantly removed (negative pulse) from a pre-industrial atmosphere (part of the CDR-pi-pulse experiment). CO2 concentration calculated (i.e. freely evolving).','56ed15d1-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(298,'esm-ssp534-over','CO2 emissions driven SSP5-3.4 overshoot scenario simulation optionally extending to year 2300 (part of the CDR-overshoot experiment). The scenario follows SSP5-8.5, an unmitigated baseline scenario, through 2040, and then substantially negative net emissions thereafter.  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).','56ed15d2-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(299,'esm-yr2010CO2-cdr-pulse','Upon initialization from end of year 2015 of esm-yr2010CO2-control instantaneously remove 100 Gt C (\"negative pulse\"; part of the CDR-yr2010-pulse experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). In this experiment CO2 is first prescribed to diagnose emissions; however, the key simulations calculate the CO2 concentration.','56ed15d3-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(300,'land-ssp434','Offline land surface simulations forced with ScenarioMIP SSP4-34.  Three realisations required.  A trend preserving statistical bias correction method is applied to 3-hourly surface meteorological variables from the scenario output to generate a set of ensemble forcing data.  Gridded forcings will be provided by LS3MIP. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.','21d8e3e4-7ed4-11e8-b252-1c4d70487308','LS3MIP',NULL,'01.00.28',NULL),(301,'land-ssp585','Offline land surface simulations forced with ScenarioMIP SSP5-85.  Three realisations required.  A trend preserving statistical bias correction method is applied to 3-hourly surface meteorological variables from the scenario output to generate a set of ensemble forcing data.  Gridded forcings will be provided by LS3MIP. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.','f16eb5f8-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL),(302,'esm-yr2010CO2-CO2pulse','Upon initialization from end of year 2015 of esm-yr2010CO2-control instantaneously introduce 100 Gt C (\"positive pulse\"; part of the CDR-yr2010-pulse experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). In this experiment CO2 is first prescribed to diagnose emissions; however, the key simulations calculate the CO2 concentration.','56ed15d5-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(303,'esm-ssp585-ocn-alk-stop','Simulation of abrupt termination of ocean alkalinsation in 2070 during an emission driven SSP5-8.5 scenario (part of the CDR-ocean-alk experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).','56ed15ce-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL),(304,'yr2010CO2','Branch from beginning of year 2010 of the historical simulation with CO2 concentration and all other forcing held fixed at 2010 level (part of the CDR-yr2010-pulse experiment to diagnose CO2 emissions).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). In this experiment CO2 is first prescribed to diagnose emissions; however, the key simulations calculate the CO2 concentration.','56ed15d6-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL);
