INSERT INTO `t2e_notes` VALUES (1,1,'Set up as a hybrid case with \r\nRUN_REFCASE=b.e20.B1850.f09_g17.pi_control.all.299 \r\nRUN_REFDATE: 0134-01-01\r\nRUN_STARTDATE: 0001-01-01\r\n\r\nThe ocean IC for this reference directory has been merged with spun-up BGC from Keith Lindsey:\r\nb.e20.B1850.f09_g17.pi_control.all.299.merge.bf_spin.032.1030.pop.r.0134-01-01-00000.nc\r\n\r\nThe atmosphere IC file comes from a BW1850 WACCM6 run:\r\nncdata = \'/gpfs/fs1/p/cesmdata/cseg/inputdata/cesm2_init/b.e20.BW1850.f09_g17.298/0011-01-01/b.e20.BW1850.f09_g17.298.cam.i.0011-01-01-00000.nc\'\r\n\r\n\r\n\r\n        \r\n        \r\n','2018-07-24 13:25:14',334),(3,3,'Set up as a CESM hybrid case with \r\nRUN_REFCASE=b.e20.B1850.f09_g17.pi_control.all.299 \r\nRUN_REFDATE: 0134-01-01\r\nRUN_STARTDATE: 0001-01-01\r\n\r\nIC specific information coming soon.','2018-08-07 13:09:08',334),(4,4,'3-member ensemble members branch from b.e21.BW1850.f09_g17.CMIP6-piControl.001 at dates 0056-01-01, 0061-01-01, and 0070-01-01. Reference dates were selected to sample variability in ENSO, PDO, AMOC, and QBO states.','2018-08-07 22:50:06',262),(5,5,'3-member ensemble members branch from b.e21.BW1850.f09_g17.CMIP6-piControl.001 at dates 0056-01-01, 0061-01-01, and 0070-01-01. Reference dates were selected to sample variability in ENSO, PDO, AMOC, and QBO states.','2018-08-07 22:50:06',NULL),(6,6,'3-member ensemble members branch from b.e21.BW1850.f09_g17.CMIP6-piControl.001 at dates 0056-01-01, 0061-01-01, and 0070-01-01. Reference dates were selected to sample variability in ENSO, PDO, AMOC, and QBO states.','2018-08-07 22:50:06',NULL),(7,12,'Ensemble members 001, 002, and 003 initialized from year 1950-01-01 ICs for WACCM and CLM from the respective CMIP6 historical WACCM simulations 001, 002, and 003.','2018-09-21 15:13:01',262),(8,13,'Ensemble members 001, 002, and 003 initialized from year 1950-01-01 ICs for WACCM and CLM from the respective CMIP6 historical WACCM simulations 001, 002, and 003.','2018-09-21 15:13:01',NULL),(9,14,'Ensemble members 001, 002, and 003 initialized from year 1950-01-01 ICs for WACCM and CLM from the respective CMIP6 historical WACCM simulations 001, 002, and 003.','2018-09-21 15:13:01',NULL),(10,15,'','2018-10-01 13:57:21',27),(11,16,'','2018-10-01 13:57:21',NULL),(12,17,'','2018-10-01 13:57:21',NULL),(14,19,'','2018-10-01 13:57:21',NULL),(15,20,'','2018-10-01 13:57:21',NULL),(16,21,'','2018-10-01 13:57:21',NULL),(17,22,'','2018-10-01 13:57:21',NULL),(18,23,'','2018-10-01 13:57:21',NULL),(19,24,'','2018-10-01 13:57:21',NULL),(20,25,'We assume this is being done with GSWP3 atmospheric forcing. This can be set in create new case options.','2018-10-17 15:29:27',196),(21,26,'Same as LS3MIP land-hist experiment but no Land Use.','2018-10-17 15:33:23',196),(22,7,'Compset B1850 is for a fully-coupled simulation for pre-industrial conditions with\r\n forcing representative of the climate in 1850. The release includes model output \r\nfor a 300-year pre-industrial control simulation (run #297). The default initial \r\nconditions for this compset are from this control simulation at year 130. ','2018-11-14 15:12:56',334),(23,7,'The dataset is 22 Tbytes total and contains raw model history stream NetCDF \r\noutput files. The model data sets for this experiment are available via \r\nanonymous gridftp at endpoint\r\n\r\n<pre>gridanon.cgd.ucar.edu/ftp/cesm2.0.0/b.e20.B1850.f09_g17.pi_control.all.297</pre>\r\n\r\nor directly from NCAR for users with glade access at:\r\n\r\n<pre>/glade/p_old/cesm0005/archive/b.e20.B1850.f09_g17.pi_control.all.297</pre>','2018-11-14 15:14:23',334),(24,9,'Compset BHIST is for performing a fully-coupled simulation of the historical period \r\nfrom 1850-2005. The release includes model output from one such simulation. The \r\ndefault initial conditions for the compset also come from year 130 of run #297, a\r\n pre-industrial control simulation. ','2018-11-14 15:19:53',334),(25,9,'The dataset is 10 Tbytes total and contains raw model history stream NetCDF \r\noutput files. The model data sets for this experiment are available via \r\nanonymous gridftp at endpoint\r\n\r\n<pre>gridanon.cgd.ucar.edu/ftp/cesm2.0.0/b.e20.BHIST.f09_g17.20thC.297_01</pre>\r\n\r\nor directly from NCAR for users with glade access at:\r\n\r\n<pre>/glade/p_old/cesm0005/archive/b.e20.BHIST.f09_g17.20thC.297_01</pre>','2018-11-14 15:20:44',334),(26,8,'Compset BHIST is for performing a fully-coupled simulation of the historical period \r\nfrom 1850-2005. The release includes model output from one such simulation. The\r\n default initial conditions for the compset also come from year 130 of run #297, a \r\npre-industrial control simulation. ','2018-11-14 15:37:54',334),(27,8,'The dataset is 8.9 Tbytes total and contains raw model history stream NetCDF \r\noutput files. The model data sets for this experiment are available via \r\nanonymous gridftp at endpoint\r\n\r\n<pre>gridanon.cgd.ucar.edu/ftp/cesm2.0.0/b.e20.BHIST.f09_g17.20thC.297_05</pre>\r\n\r\nor directly from NCAR for users with glade access at:\r\n\r\n<pre>/glade/p_old/cesm0005/archive/b.e20.BHIST.f09_g17.20thC.297_05</pre>','2018-11-14 15:38:45',334),(28,39,'','2018-11-14 16:45:17',NULL),(29,40,'','2018-11-14 16:45:17',NULL),(30,44,'','2018-12-10 16:53:56',NULL),(31,45,'','2018-12-10 16:53:56',NULL),(32,46,'This run includes the bugfix for wetland in Antarctica. ','2018-12-11 16:14:04',27);
